import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('Typo Formal Bold Italic Demo-bolditalic.ttf', font);
this.addFont('Typo Formal Bold Italic Demo-bolditalic.ttf', 'Typo Formal Bold Italic Demo', 'bolditalic');
};
jsPDF.API.events.push(['addFonts', callAddFont])
